-- title:  The Cavern
-- author: Balistic Ghoul games with sprites by Adam Saltsman
-- desc:   This game is like Lara Croft GO exept it uses pixel art and is not 3D
-- script: lua
DEBUG=false

--FLAGS
--0=solid
--1=Hazard
--2=Breakable
--3=Ladder
--4=Movable
--5=Can jump up through, but solid on the top
--6=Pot?
--7=Water

t=0

p={
 x=238*8,
 y=9*8,
	flp=0,
	bs=256
}

face=true

lastx=239
lasty=50

vw=30
vh=16

vwh=vw/2
vhh=vh/2

gravity=0.3
friction=0.83

function TIC()

 function move(dx,dy)
	  local nx=p.x+dx
	  local ny=p.y+dy
		 if not fget(mget(nx,ny),0) then
		  p.x=nx
		  p.y=ny
		 end
	 end

	if btnp(0) then move(0,-8) face=false end
	if btnp(1) then move(0,8) face=false end
	if btn(2) then move(-1,0) p.flp=1 face=true end
	if btn(3) then move(1,0) p.flp=0 face=true end

	cls(0)
	local mx=math.min(lastx-vw,math.max(0,p.x/8-vwh))
	local my=math.min(lasty-vh,math.max(0,p.y/8-vhh))
	mx=p.x/8-vwh
	map(mx,my)
	local ps=p.bs
	if face==true then
	 spr(ps+t%150//30,(p.x-mx*8),(p.y-my*8),0,1,p.flp)
	elseif face==false then
	 spr((ps+5)+t%120//30,(p.x-mx*8),(p.y-my*8),0,1,p.flp)
	end
	--Draw Hp (Adjust later)
	spr(368,0,0,0)
	spr(368,1*8,0,0)
	spr(368,2*8,0,0)
	spr(368,3*8,0,0)
	spr(368,4*8,0,0)
	--Draw items (Adjust later)
	spr(384,0,1*8,0)
	spr(385,1*8,1*8,0)
	spr(386,2*8,1*8,0)
	spr(387,3*8,1*8,0)
	
	t=t+4
end

